description:
Way back, when our country was young, the West was still east of the Mississippi and the truly great Americans were the intrepid pioneers of the backwoods of New York, Pennsylvanis and Ohio - where the woods were thick and sown with sudden death...the greatest of the backwoodsmen was Dan Brand - ancestor of Steve Brand - and his little Indian friend, Tipi, who blazed new trails of adventure for others to follow, pushing civilization and justice across the continent of the &quot;New&quot; world! Here was white American and brown American fighting common deadly enemies side by side!

